//int reminder(int, int) - find remainder and return 
public class MethodQ17 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=5,b=10;
		System.out.println(remainder(a,b));
	}

	static int remainder(int a, int b) {
		return a%b;
	}
	}

